['#include<stdio.h>
#include<stdlib.h>
int fun(int ,int ,char *);
int fun(int n,int k,char *s)
{
    int i,start=0,end=0;
    for(i=0;i<n;i++)
    {
        if(s[i]=='G')
        {
            start=i;
        }
        if(s[i]=='T')
        {
            end=i;
        }
    }
    if(start<end)
    {
        for(;s[start]!='\0';start+=k)
        {
            if(s[start]=='#')
            {
                return 0;
            }
            if(start==end)
            {
                return 1;
            }
        }
        return 0;
    }
    if(start>end)
    {
        for(;s[end]!='\0';end+=k)
        {
            if(s[end]=='#')
            {
                return 0;
            }
            if(start==end)
            {
                return 1;
            }
        }
        return 0;
    }
}
int main()
{
    int n,k;
    char a[10000];
    scanf("%d%d%s",&n,&k,a);
    printf((fun(n,k,a)==1)?"YES\n":"NO\n");
    return 0;
}']

