['#include<stdio.h>
#include<malloc.h>
void merge(long int a[],long int first,long int mid,long int last)
{
  long int *b=(long int *)malloc(sizeof(long int)*(last-first+1));
  long int i,j,k;
  i=first;j=mid+1;k=0;
  while(i<=mid&&j<=last)
  {
    if(a[i]>a[j])
      b[k++]=a[i++];
    else
      b[k++]=a[j++];
  }
  while(i<=mid)
    b[k++]=a[i++];
  while(j<=last)
    b[k++]=a[j++];
  j=0;
  for(i=first;i<=last;i++)
  {
    a[i]=b[j];
    j++;
  }
}
void mergesort(long int a[],long int first,long int last)
{
  long int mid;
  if(first<last)
  {
    mid=(first+last)/2;
    mergesort(a,first,mid);
    mergesort(a,mid+1,last);
    merge(a,first,mid,last);
  }
}
int main()
{
    long int n,n1,n2,i,j,temp;
    scanf("%d %d %d",&n,&n1,&n2);
    long int a[n];
    for(i=0;i<n;i++)
        scanf("%d",&a[i]);
    mergesort(a,0,n-1);
    int min,max;
    if(n1<n2)
    {
        min=n1;
        max=n2;
    }
    else
    {
        min=n2;
        max=n1;
    }
    int sum1=0,sum2=0;
    for(i=0;i<min;i++)
        sum1+=a[i];
    for(j=min;j<max+min;j++)
        sum2+=a[j];
    float f1=sum1;
    float f2=sum2;
    f1/=min;
    f2/=max;
    printf("%f",f1+f2);
    return 0;
}
']

