#include<malloc.h>
void sort(int *a,int n)
{
	int i,j,b;
	for (i = 0; i < n; ++i)
	{
		for (j = i + 1; j < n; ++j)
		{
			if (a[i] < a[j])
			{
				b = a[i];
				a[i] = a[j];
				a[j] = b;
			}
		}
	}
}
int main()
{
	int n,n1,n2,i,j=0,aa,bb;
	float sum1=0,sum2=0,sum=0;
	scanf("%d %d %d",&n,&n1,&n2);
	if(n1>=n2)
	{
		aa=n2;
		bb=n1;
	}
	else
	{
		aa=n1;
		bb=n2;
	}
	int *a=malloc(sizeof(int)*n);
	int *b=malloc(sizeof(int)*aa);
	int *c=malloc(sizeof(int)*bb);
	for(int i=0;i<n;i++)
		scanf("%d",&a[i]);
	sort(a,n);
	for(i=0;i<aa;i++)
	{
		b[i]=a[j];
		sum1+=b[i];
		j++;
	}
	for(i=0;i<bb;i++)
	{
		c[i]=a[j];
		sum2+=c[i];
		j++;
	}
	sum=(sum1/aa)+(sum2/bb);
	printf("%.8f",sum);
}']

