['#include <stdio.h>
#define size 100000
void swap(int* xp, int* yp) 
{ 
    int temp = *xp; 
    *xp = *yp; 
    *yp = temp; 
} 
  
void selectionSort(int arr[], int n) 
{ 
    int i, j, max_idx; 
  
    // One by one move boundary of unsorted subarray 
    for (i = 0; i < n - 1; i++) { 
  
        // Find the minimum element in unsorted array 
        max_idx = i; 
        for (j = i + 1; j < n; j++) 
            if (arr[j] > arr[max_idx]) 
                max_idx = j; 
  
        // Swap the found minimum element 
        // with the first element 
        swap( &arr[i],&arr[max_idx]); 
    } 
} 

int main()
{
    int n,n1,n2,i;
    int a[size];
    float sum=0,min,max;
    double m1,m2;
    
    scanf("%d",&n);
    scanf("%d %d",&n1,&n2);
    
    for(i=0;i<n;i++){
        scanf("%d",&a[i]);
    }
    selectionSort(a,n);
    if(n1<n2){
        min=n1;
        max=n2;
    }
    else{
        min=n2;
        max=n1;
    }
    for(i=0;i<min;i++){
        sum=sum+a[i];
    }
    m1=sum/min;
    sum=0;
    for(i=min;i<(max+min);i++){
        sum=sum+a[i];
    }
    m2=sum/max;
    printf("%e",m1+m2);
    

    return 0;
}']

