['#include<stdio.h>

void merge(long int arr[],long int l,long int m,long int r)
{
    long int i, j, k;
    long int n1 = m - l + 1;
    long int n2 =  r - m;
    long int L[n1], R[n2];
    for (i = 0; i < n1; i++)
        L[i] = arr[l + i];
    for (j = 0; j < n2; j++)
        R[j] = arr[m + 1+ j];
    i = 0;
    j = 0;
    k = l;
    while (i < n1 && j < n2)
    {
        if (L[i] >= R[j])
        {
            arr[k] = L[i];
            i++;
        }
        else
        {
            arr[k] = R[j];
            j++;
        }
        k++;
    }
    while (i < n1)
    {
        arr[k] = L[i];
        i++;
        k++;
    }
    while (j < n2)
    {
        arr[k] = R[j];
        j++;
        k++;
    }
}

void mergeSort(long int arr[],long int l,long int r)
{
    if (l < r)
    {
        long int m = l+(r-l)/2;
        mergeSort(arr, l, m);
        mergeSort(arr, m+1, r);
        merge(arr, l, m, r);
    }
}

int main()
{
    long int n,n1,n2,i,temp;
    long long int sum1=0,sum2=0;
    scanf("%ld %ld %ld",&n,&n1,&n2);
    long int a[n];
    for(i=0;i<n;i++)
        scanf("%ld",&a[i]);
    mergeSort(a,0,n-1);
    if(n1>n2)
    {
        temp=n1;
        n1=n2;
        n2=temp;
    }
    float f1=0,f2=0;
    for(i=0;i<n1;i++)
    {
        sum1+=a[i];
    }
    for(;i<n1+n2;i++)
    {
        sum2+=a[i];
    }
    f1=(float)sum1/n1;
    f2=(float)sum2/n2;
    printf("%f",f1+f2);
}
']

