void sort(int *a,int l,int mid,int u)
{
    int *b=(int *)malloc(sizeof(int)*(u-l+1));
    int x,i=l,j=mid+1,k=0;
    while(i<=mid && j<=u)
    {
        if(a[i]>a[j])
        {
            b[k]=a[i];
            k++;
            i++;
        }
        else
        {
            b[k]=a[j];
            k++;
            j++;
        }
    }
    while(i<=mid)
    {
        b[k]=a[i];
        i++;
        k++;
    }
    while(j<=u)
    {
        b[k]=a[j];
        j++;
        k++;
    }
    for(x=0;x<k;x++)
    {
        a[x+l]=b[x];
    }
}
void merge(int *a,int l,int u)
{
    if(l<u)
    {
        int mid;
        mid=(u + l)/2;
        merge(a,l,mid);
        merge(a,mid+1,u);
        sort(a,l,mid,u);
    }
}
int main()
{
    int n,n1,n2,*a,i,j,temp;
    scanf("%d %d %d",&n,&n1,&n2);
    a=(int *)malloc(sizeof(int)*n);
