['#include<stdio.h>
#include<malloc.h>
int partition(int a[],int l,int u)
{
    int i,j,temp,part=l+1,pivot=a[l];
    for(i=l+1;i<=u;i++)
    {
        if(a[i]>pivot)
        {

            temp=a[i];
            a[i]=a[part];
            a[part]=temp;
            part++;
        }
    }
    a[l]=a[part-1];
    a[part-1]=pivot;
    return part-1;

}
void sort(int a[],int l,int u)
{
    int j;
    if(l<u)
    {
        j=partition(a,l,u);
        sort(a,l,j-1);
        sort(a,j+1,u);
    }
}

int main()
{
    int n,n1,n2,*a,i,j,temp;
    scanf("%d %d %d",&n,&n1,&n2);
    a=(int *)malloc(sizeof(int)*n);
    for(i=0;i<n;i++)
        scanf("%d",&a[i]);
    sort(a,0,n-1);
    int min,max;
    if(n1<n2)
    {
        min=n1;
        max=n2;
    }
    else
    {
        min=n2;
        max=n1;
    }
    float sum1=0.0,sum2=0.0;
    for(i=0;i<min;i++)
        sum1+=a[i];
    for(j=i;j<max+i;j++)
        sum2+=a[j];
    float avg=(sum1/min)+(sum2/max);
    printf("%f",avg);
    return 0;
}
