	scanf("%d%d",&n,&k);
	getchar();
	for(i=1;i<=n;i++)
	{
		scanf("%c",&s[i]);
		if(s[i]=='T') 
		{
			target=i;
		}
		if(s[i]=='G') 
		{
			grass=i;
		}
	}
	if(grass<target)
	{
		j=grass;
		while(s[j]!='#'&&j<target)
		{
			j+=k;
			if(s[j]=='T') 
			{
				flag=1;
			}
		}
	}
	if(grass>target)
	{
		j=grass;
		while(s[j]!='#'&&j>target)
		{
			j-=k;
			if(s[j]=='T') 
			{
				flag=1;
			}
		}
	}
	if(flag==1) 
	{
		printf("YES\n");
	}
	else
	{
		printf("NO\n");
	}
	return 0;
}']

