['#include <stdbool.h>
#include <stdio.h>

int main(void)
{
  unsigned short cells;
  unsigned short jump;
  scanf("%hu%hu", &cells, &jump);
  char line[cells];

  unsigned short grasshopper_position;
  unsigned short target_position;

  for (unsigned short i = 0; i < cells; ++i)
  {
    line[i] = getchar();
    if (line[i] == 'G')
      grasshopper_position = i;
    else if (line[i] == 'T')
      target_position = i;
  }

  if (target_position < grasshopper_position)
    jump = -jump;

  bool flag = false;

  while (true)
  {
    if (line[grasshopper_position + jump] == 'T')
    {
      flag = true;
      break;
    }
    else if (line[grasshopper_position + jump] == '.')
      grasshopper_position += jump;
    else
      break;
  }

  flag ? puts("YES") : puts("NO");

  return 0;
}
']

