['#include <stdio.h>
#include <stdlib.h>
#include <math.h>

void indexOf(char *arr, int n, int *G, int *T) {
    int cnt = 0;
    for (int i = 0; i < n; i++) {
        if (arr[i] == 'G') {
            *G = i;
            cnt++;
        } else if (arr[i] == 'T') {
            *T = i;
            cnt++;
        }

        if (cnt == 2) return;
    }
}

int main() {
    int n, k;
    scanf("%d %d", &n, &k);
    char *arr = (char *) malloc(sizeof(char) * (n+ 1));
    scanf(" %s", arr);

    int G = 0;
    int T = 0;
    indexOf(arr, n, &G, &T);
    if (abs(T - G) % k != 0) {
        printf("NO");
        free(arr);
        return 0;
    }
    if (G < T) {
        int tmp = G;
        G = T;
        T = tmp;
    }
    while (T != G) {
        T += k;
        if (arr[T] == '#') {
            printf("NO");
            free(arr);
            return 0;
        }
    }
    //printf("n: %d\nk: %d\narr: %s\n", n, k, arr);
    printf("YES");
    free(arr);
    return 0;
}
