['#include <stdio.h>

int a[100100];

void swap(int *a, int *b) {
    int t;
    t = *a; *a = *b; *b = t;
}

void qs(int *a, int l, int r) {
    int piv = a[l + (r - l) / 2];
    int i = l, j = r;
    while (i <= j) {
        while (a[i] < piv) i++;
        while (a[j] > piv) j--;
        if (i <= j) {
            swap(&a[i], &a[j]);
            i++; j--;
        }
    }
    if (i <= r) qs(a, i, r);
    if (l <= j) qs(a, l, j);
}

int main() {
    int n, n1, n2;
    scanf("%d%d%d", &n, &n1, &n2);
    for (int i = 0; i < n; i++) scanf("%d", &a[i]);
    qs(a, 0, n - 1);
    if (n1 > n2) swap(&n1, &n2);
    double sm1 = 0;
    for (int i = n - 1; i >= n - n1; i--) {
        sm1 += a[i];
    }
    sm1 /= (double) n1;
    double sm2 = 0;
    for (int i = n - n1 - 1; i >= n - n1 - n2; i--) {
        sm2 += a[i];
    }
    sm2 /= (double) n2;
    printf("%.9lf\n", sm1 + sm2);
}']

