#include <stdio.h>
#include <stdlib.h>
#include <string.h>
int main()
{
    //grasshopper
    int n,k;
    scanf("%d %d",&n,&k);
    char *s=(char *)malloc((n+1)*sizeof(char));
    scanf("%s",s);
    int i,g,t;
    for(i=0;i<n;i++)
    {
        if(s[i]=='G')
            g=i;
        if(s[i]=='T')
            t=i;
    }
    if(g<t)
    {
        int pos=g;
        while(pos<t)
        {
            pos=pos+k;
            if(s[pos]=='#')
                break;
        }
        if(pos==t)
            printf("YES\n");
        else
            printf("NO\n");
    }
    else
    {
        int pos=g;
        while(pos>t)
        {
            pos=pos-k;
            if(s[pos]=='#')
                break;
        }
        if(pos==t)
            printf("YES\n");
        else
            printf("NO\n");
    }
    return 0;
}
