['#include <stdio.h>

double a[100100];

void swap(double *a, double *b) {
    int t;
    t = *a; *a = *b; *b = t;
}

void qs(double *a, int l, int r) {
    double piv = a[l + (r - l) / 2];
    int i = l, j = r;
    while (i <= j) {
        while (a[i] < piv) i++;
        while (a[j] > piv) j--;
        if (i <= j) {
            swap(&a[i], &a[j]);
            i++; j--;
        }
    }
    if (i <= r) qs(a, i, r);
    if (l <= j) qs(a, l, j);
}

int main() {
    double n, n1, n2;
    scanf("%lf%lf%lf", &n, &n1, &n2);
    for (int i = 0; i < n; i++) scanf("%lf", &a[i]);
    qs(a, 0, n - 1);
    if (n1 > n2) swap(&n1, &n2);
    double sm1 = 0;
    for (int i = (int) n - 1; i >= (int) n - n1; i--) {
        sm1 += a[i];
    }
    sm1 /= n1;
    double sm2 = 0;
    for (int i = (int) n - n1 - 1; i >= (int) n - n1 - n2; i--) {
        sm2 += a[i];
    }
    sm2 /= n2;
    printf("%.9lf\n", sm1 + sm2);
}
