        if((s[i]=='G' || s[i]=='T')&&t==1){j++;break;}
        if((s[i]=='G'|| s[i]=='T')&&t==0){t=1;p=i;}
    }
    if(j%k!=0)printf("NO");
    else
    {
        p=p+k;
        while(p<=n)
        {
            if(s[p]=='#'){printf("NO");return 0;}
            else if(s[p]=='G' || s[p]=='T'){printf("YES");return 0;}
            p+=k;
        }
        printf("NO");
    }
    return 0;
}


